func TestAAA(t *testing.T) {
	client, err := ethclient.Dial("https://endpoints.omniatech.io/v1/base/mainnet/public")
	if err != nil {
		return
	}
	pool, err := NewPool(common.HexToAddress("0x817b532F49AAc2c229b2f8819295D78FE68f7246"), client)
	if err != nil {
		return
	}
	reserves, err := pool.GetReserves(nil)
	if err != nil {
		return
	}
	t.Log(reserves)
}

func TestBBB(t *testing.T) {
	code, err := hex.DecodeString("")
	if err != nil {
		return
	}
	t.Log(hex.EncodeToString(crypto.Keccak256(code)))
}

func TestCCC(t *testing.T) {
	t.Log(big.NewInt(10000).Exp(big.NewInt(10), big.NewInt(6), nil).String())
}

func Prit(a *big.Int) string {
	return a.String()
}
